import React from 'react';


export default class SummonerHistory extends React.Component{

    constructor(props)
    {
        super(props);
        this.state={
            leaguePoints: props.leaguePoints,
            losses: props.losses,
            queueType: props.queueType,
            rank: props.rank,
            tier: props.tier,
            wins: props.win,
        };
    }

    render()
    {
        console.log(this.state);
        return(
                 <p>
                    {this.state.queueType}
                </p>
    
        );
    }

}
